import React, { useState, useEffect } from 'react';
import './admin.css'; // Make sure CSS is applied

const AdminPage = () => {
  const [surveyData, setSurveyData] = useState([]);

  useEffect(() => {
    const storedData = JSON.parse(localStorage.getItem('surveyAnswers')) || [];
    console.log("Loaded survey data:", storedData); // Debugging
    setSurveyData(storedData);
  }, []);

  return (
    <div className="admin-page">
      <h2>Survey Responses</h2>
      {surveyData.length === 0 ? (
        <p>No survey responses found.</p>
      ) : (
        <table>
          <thead>
            <tr>
              <th>Session ID</th>
              <th>Responses</th>
            </tr>
          </thead>
          <tbody>
            {surveyData.map((session, index) => (
              <tr key={index}>
                <td>{session.sessionId}</td>
                <td>
                  {Object.entries(session.answers).map(([questionId, answer], idx) => (
                    <div key={idx}>
                      <strong>Question {questionId}:</strong> {answer}
                    </div>
                  ))}
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default AdminPage;
